description-0: I am a Software Engineer with over 15 years of experience in application development and architecture. I have started with the LAMP stack many years ago and as my interest for the JavaScript and frontend development grew, I moved slowly over to Nodejs and later onto cloud computing with AWS. 
description-1: I have been developing software in AWS for about 6 years now, working primarily with services such as Lambda, EC2, ECS, RDS, API Gateway, Cognito and SFN. I enjoy working on cloud based solutions as they offer scalability and a wide variety of services which can be used to build feature rich applications.
description-2: I have a great deal of interest for Open Source technologies. Integrations and application development are the areas in which I spent most of my professional life. My recent technology stack is NodeJs, Typescript and AWS. In my spare time I enjoy training, running and spending time with my friends and family.
